private Image loadFrameIcon() {
    Toolkit toolkit = Toolkit.getDefaultToolkit();
    try {
        java.net.URL url = BaseTestRunner.class.getResource("smalllogo.gif");
        return toolkit.createImage((ImageProducer) url.getContent());
    } catch (Exception ex) {
    }
    return null;
}
